@rossiucr En EEUU el sistema educativo detecta a chicos/as con potencial y los asigna a escuelas especiales donde eso puede trabajarse.  
Los mejores terminan recibiendo becas hasta finalizar la universidad.
Así se aprovechan y desarrollan  los recursos humanos más capacitados.

@victorfyt Sin embargo, teniendo escuelas y universidades gratis, más becas y subsidios y ayudas económicas, son poquísimos los "negros" que estudian y terminan. 
Si de verdad estudiaran y pensaran, habría más profesionales trabajando en vez de 75% de niños/as pobres. 
